import { useState } from "react";
import * as S from "./styles";
import WeeklyModal from "../../components/Modal";
import Button from "../../components/buttons/buttonComum";

export default function Buttons() {
  return (
    <S.Container>
      <h1>Botoes</h1>
      <button
        onClick={() => {
          onOpenPopUp(true);
        }}
      >
        Entrar
      </button>
      <Button
        title="Hello"
        bgColor="green"
        bgColorActive="pink"
        colorFont="pink"
        colorFontActive="green"
        width="200px"
        height="50px"
        radius="10px"
        fontSize="16px"
        padding="5px"
        shadow="#ffffff7e"
      />
      <WeeklyModal handleClose={handleClose} open={isOpenPopUp} />
    </S.Container>
  );
}
